package java_day6_practice;

import java.util.Arrays;

public class SortArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int array_data[] = {90, 121, 98, 22, 33};
		Arrays.sort(array_data);
		System.out.println(Arrays.toString(array_data));
		
		String array_str_data[] = {"Tharun", "Harish", "Raviteja", "Mahesh"};
		Arrays.sort(array_str_data);
		System.out.println(Arrays.toString(array_str_data));

	}

}
